USE `Region C`;

CREATE TABLE CUSTOMERS(
    CUSTOMER_ID INT(6) AUTO_INCREMENT PRIMARY KEY, 
    CUST_FIRST_NAME VARCHAR(20), 
    CUST_LAST_NAME VARCHAR(20), 
    CREDIT_LIMIT DECIMAL(9,2), 
    CUST_EMAIL VARCHAR(30), 
    INCOME_LEVEL VARCHAR(20), 
    REGION CHAR(1)
);


CREATE TABLE CUSTOMERS_REGION_C AS
SELECT * FROM CUSTOMERS WHERE REGION = 'C' OR REGION = 'D';
#DROP TABLE CUSTOMERS;

SELECT * FROM CUSTOMERS_REGION_C; 

CREATE TABLE PRODUCT_INFORMATION (
    PRODUCT_ID INT(6), 
    PRODUCT_NAME VARCHAR(50), 
    PRODUCT_DESCRIPTION VARCHAR(2000), 
    CATEGORY_ID INT(2), 
    WEIGHT_CLASS INT(1), 
    WARRANTY_PERIOD VARCHAR(5), 
    SUPPLIER_ID INT(6), 
    PRODUCT_STATUS VARCHAR(20), 
    LIST_PRICE DECIMAL(8,2), 
    MIN_PRICE DECIMAL(8,2), 
    CATALOG_URL VARCHAR(50)
);


